        <p>Also, verbs of communication and thinking are presented here: <strong>to speak</strong>, <strong>to listen</strong>, <strong>to hear</strong>, <strong>to watch</strong>, <strong>to see</strong>, <strong>to think</strong>, <strong>to know</strong>, <strong>to understand</strong>, <strong>to ask</strong>, <strong>to answer</strong>, <strong>to feel</strong>.</p>
