        <p>Ты сможешь спрашивать о месте, времени и причине: <strong>где</strong> (миччахьа), <strong>когда</strong> (маца), <strong>почему</strong> (х1унда), <strong>зачем</strong> (х1унда), <strong>откуда</strong> (мичхьара), <strong>куда</strong> (стенга).</p>
